import React from 'react'

export default function SurveyContainer({ surveys }) {

    const displaySurveyCards = () => surveys.map(survey => {
        return <SurveyCard survey={survey} />
    })

    return (
        <div className='survey-container'>
            {displaySurveyCards}
        </div>
    )
}
